def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return None
    result = []
    parts = input1.split()
    for part in parts:
        sub_parts = part.split('-')
        for i in range(len(sub_parts)):
            if i > 0:
                sub_parts[i] = sub_parts[i].capitalize()
        result.append(''.join(sub_parts))
    return ' '.join(result)
